bool prime(int q){
    if(q < 2)
        return false;
    for(int i = 2;i * i <= q;i++)
        if(!(q % i))
            return false;
    return true;
}

bool pal(int x){
    int tmp = x;
    int y = 0;
    do{
        y *= 10;
        y += tmp % 10;
    }while(tmp /= 10);
    return x == y;
}

